@use '../../global-styles/variables.scss' as *;

.sections {
  display: flex;
  flex-direction: column;
  row-gap: calc(7 * $ru);
  align-items: center;
}

.section {
  &.one {
    padding-top: calc(5 * $ru);
    width: calc(100 * $ru);
  }
  &.two {
    padding-top: calc(2 * $ru);
    width: calc(85 * $ru);

    p {
      position: relative;
      color: black;
    }

    ul {
      list-style-type: '• ';
    }

    li {
      position: relative;
      color: #000000;
    }
  }

  &.four {
    h4 {
      text-align: center;
    }
  }

  h2,
  h3 {
    text-align: center;
  }
}

.divider {
  width: calc(10 * $ru);
}

